import React from 'react'

const Header = (props) =>{
  return(
    <div>
      <h1>{props}</h1>
    </div>
  )

}
const Course = (props) => {
    const { course } = props
    console.log(course)

    return (
      <div>
         <Header content={course.name} />
      </div>
    )
}

export default Course
